import { Route } from '@angular/router';
import { DetailsComponent } from './details';

export const EXPENSES_ROUTES: Route[] = [
  {
    path: '',
    loadComponent: () => import('./').then((m) => m.ExpensesComponent)
  },
  {
    path: 'new',
    component: DetailsComponent,
    loadComponent: () => import('./').then((m) => m.ExpensesComponent)

  },
  // {
  //   path: `:id`,
  //   component: DetailsComponent
  // }
];
